       SET pos = pos +1;
       SET pri = CONCAT(pri,'<didnt incr>'); 
    END IF;
	END WHILE;
	IF pri != sec THEN
		SET pri = CONCAT(pri, ';', sec);
  END IF;
	RETURN (pri);
